import {
    LOGIN,
    SIGNUP
} from './actionTypes'
import { loginSuccess } from './action'


export const initState = {
    loginSuccess:[]
}

export default (state = initState, { type, payload }) => {
    console.log(payload)

    switch (type) {
        case LOGIN:
            if(loginSuccess.mess)
            return{
                ...state,
                loginSuccess:payload
            }

        default:
            return state
    }
}
